(468, 'ruRU', 'Императорский цийлинь', '|cFFFFD200Промоакция:|r коллекционное издание Mists of Pandaria', 'Любимцы древних правителей могу, цийлини станут верным и бесстрашным компаньоном любому наезднику.', 35435),
(1282, 'ruRU', 'Черный змей Н\'Зота', '|cFFFFD200Достижение:|r \"Сквозь глубины видений\"', 'Черные змеи Н\'Зота возвещают о скором осуществлении планов Древнего бога. Поймать такого змея способны только те служители или враги Н\'Зота, кто может войти в его видения.', 35435);
INSERT INTO `player_condition_locale` (`ID`, `locale`, `FailureDescription_lang`, `VerifiedBuild`) VALUES
(79509, 'ruRU', 'Изучите любую сущность 3-го уровня, полученную от Ржавоболтского сопротивления, другим персонажем, чтобы открыть эту сущность.', 35435),
